import './Header.css';
import NavBar from '../../components/menu/NavBar';
import Slider from '../../components/slider/Slider';
import Brands from '../../components/brands/Brands';

function Header() {
  return (
    <>
      <section className="header">
        <NavBar/>
      </section>
        <Slider/>
    </>
  );
}

export default Header;
